import React from 'react';

const Recipes = (props) => {
    return (
        <div className="container">
           <div className="row">
               { props.recipes.map((recipe) => {
                   return (
                       <div className="col-md-4">
                           <div className="recipes__box">
                               <img src="" alt=""/>
                           </div>
                       </div>
                   );
               }) }
           </div>
        </div>
    );
};

export default Recipes;
